import React from 'react'; 
import Card from './Card.js';
import ListPeople from './ListPeople.js';

const ListPeopleHandler = (props) => {
  return (
      <li>
        {props.users.map((user) => (
           <ListPeople
           id={user.id}
           name={user.name}
           username = {user.username}
           email = {user.email}
           />
        ))}
      </li>
  );
};

export default ListPeopleHandler;
